/* This script inserts static data into DB on startup */
DROP TABLE IF EXISTS STATIC_STATIONS;
DROP TABLE IF EXISTS STATIC_TYPES;

CREATE TABLE STATIC_STATIONS (
STATION_ID INTEGER NOT NULL,
STATION_NAME VARCHAR(100),
SOLAR_SYSTEM_ID INTEGER,
SOLAR_SYSTEM_NAME VARCHAR(30),
CONSTELLATION_ID INTEGER,
REGION_ID INTEGER,
SECURITY_STATUS FLOAT,
CONSTRAINT PK_STATIC_STATIONS PRIMARY KEY (STATION_ID)
);

CREATE TABLE STATIC_TYPES (
TYPE_ID INTEGER NOT NULL,
VOLUME FLOAT,
CAPACITY FLOAT,
CONSTRAINT PK_STATIC_TYPES PRIMARY KEY (TYPE_ID)
);

CREATE UNIQUE INDEX IX_STATIC_STATIONS_PK ON PUBLIC.STATIC_STATIONS (STATION_ID);
CREATE UNIQUE INDEX IX_STATIC_TYPES_PK ON PUBLIC.STATIC_TYPES (TYPE_ID);


